import App from "@/App.vue";
import AuthUser from "@/components/authUser.vue";
import { createRouter, createWebHashHistory } from "vue-router";

const router = createRouter({
    history: createWebHashHistory(),
    routes: [
      {
        path: "/",
        name: "home",
        component: App,
      },
      {
        path: "/auth",
        name: "authUser",
        component: AuthUser,
      },
    ],
  });

export default router;
